import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" id="navbar" href="/">
        Cool Story Bro
      </a>
    </nav>
  );
}

export default Nav;
